  `song_menu_id` int(11) DEFAULT NULL,
  `song_author` varchar(300) DEFAULT NULL,
  `is_play_lists` int(1) unsigned zerofill DEFAULT '0',
  `is_temp_play_lists` int(1) unsigned zerofill DEFAULT NULL,
  PRIMARY KEY (`song_id`)
